import React from "react";
import SectionTitle from "../layout/SectionTitle01";
import ReadMoreItem01 from "../item/readMoreItem01";

const SlideList01 = ({
  title,
  children,
  hasMore,
  onMoreClick,
  additionalListClass,
}) => {
  return (
    <>
      <SectionTitle>{title}</SectionTitle>
      <div
        className={
          "slideList" + (additionalListClass ? additionalListClass : "")
        }
      >
        <ul className="listWrap">
          {children}

          {hasMore && <ReadMoreItem01 onClick={onMoreClick} />}
        </ul>
      </div>
    </>
  );
};

export default SlideList01;
